    /**
     * Every time the number of selected records is changed, we need to update a few messages and the current list of
     * selected ids.
     *
     * @param data
     */
    function bulk_update_affected(data) {
        // reset
        data.button
            .removeAttr('data-confirm_msg')
            .data('confirm_msg', '');

        var items = 0;

        // update confirm and affected
        if (data.select_all.prop('checked')) {
            items = data.select_all.data('selected');
        } else {

            data.ids = [];

            data.table.find('tbody tr td:first-child input[type="checkbox"]:checked').each(function() {
                data.ids.push($(this).val());
            });

            items = data.ids.length;
        }

        if (items === 0) {
            data.table_actions.removeClass('ba-items-selected');
            data.affected.html('');
        } else {
            // update the confirm message
            var confirm = data.button.data('confirm');
            var action = data.action_label.toLowerCase();

            items += ' ' + (data.ids.length === 1 ? data.affected.data('singular') : data.affected.data('plural'));

            confirm = confirm
                .replace(/\[action\]/g, action)
                .replace(/\[items\]/g, items);

            data.affected.html(items + ' selected');

            if (data.action.length > 0) {
                // update the confirm message
                data.button
                    .attr('data-confirm_msg', confirm)
                    .data('confirm_msg', confirm);
            }

            data.table_actions.addClass('ba-items-selected');
        }
    }

